import React, { useState, useEffect } from 'react';
import {
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField,
  Button,
  FormControlLabel,
  Checkbox,
  Grid
} from '@mui/material';

const ProductFormDialog = ({ open, mode, initialData, onClose, onSubmit }) => {
  // Set up state for all product fields. All fields are strings for simplicity,
  // except for out_of_stock which is a boolean.
  const [product, setProduct] = useState({
    amazon_url: '',
    asin: '',
    price: '',
    moq: '',
    qty: '',
    upc: '',
    cost: '',
    vendor: '',
    lead_time: '',
    exp_date: '',
    fob: '',
    vendor_id: '',
    profit_moq: '',
    image_url: '',
    title: '',
    category: '',
    out_of_stock: false,
    walmart_url: '',
    ebay_url: ''
  });

  useEffect(() => {
    if (initialData) {
      setProduct(initialData);
    } else {
      // Reset to blank if no initialData is provided (for add mode)
      setProduct({
        amazon_url: '',
        asin: '',
        price: '',
        moq: '',
        qty: '',
        upc: '',
        cost: '',
        vendor: '',
        lead_time: '',
        exp_date: '',
        fob: '',
        vendor_id: '',
        profit_moq: '',
        image_url: '',
        title: '',
        category: '',
        out_of_stock: false,
        walmart_url: '',
        ebay_url: ''
      });
    }
  }, [initialData]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setProduct(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleCheckboxChange = (e) => {
    const { name, checked } = e.target;
    setProduct(prev => ({
      ...prev,
      [name]: checked
    }));
  };

  const handleSubmit = () => {
    onSubmit(product);
  };

  return (
    <Dialog open={open} onClose={onClose} maxWidth="md" fullWidth>
      <DialogTitle>{mode === 'edit' ? 'Edit Product' : 'Add Product'}</DialogTitle>
      <DialogContent>
        <Grid container spacing={2}>
          {/* Row 1 */}
          <Grid item xs={12} sm={6}>
            <TextField
              margin="dense"
              label="Amazon URL"
              name="amazon_url"
              value={product.amazon_url}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              margin="dense"
              label="ASIN"
              name="asin"
              value={product.asin}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          {/* Row 2 */}
          <Grid item xs={12} sm={4}>
            <TextField
              margin="dense"
              label="Price"
              name="price"
              value={product.price}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={4}>
            <TextField
              margin="dense"
              label="MOQ"
              name="moq"
              value={product.moq}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={4}>
            <TextField
              margin="dense"
              label="QTY"
              name="qty"
              value={product.qty}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          {/* Row 3 */}
          <Grid item xs={12} sm={6}>
            <TextField
              margin="dense"
              label="UPC"
              name="upc"
              value={product.upc}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              margin="dense"
              label="Cost"
              name="cost"
              value={product.cost}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          {/* Row 4 */}
          <Grid item xs={12} sm={6}>
            <TextField
              margin="dense"
              label="Vendor"
              name="vendor"
              value={product.vendor}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              margin="dense"
              label="Lead Time"
              name="lead_time"
              value={product.lead_time}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          {/* Row 5 */}
          <Grid item xs={12} sm={6}>
            <TextField
              margin="dense"
              label="Exp Date"
              name="exp_date"
              value={product.exp_date}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              margin="dense"
              label="FOB"
              name="fob"
              value={product.fob}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          {/* Row 6 */}
          <Grid item xs={12} sm={6}>
            <TextField
              margin="dense"
              label="Vendor ID"
              name="vendor_id"
              value={product.vendor_id}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              margin="dense"
              label="Profit MOQ"
              name="profit_moq"
              value={product.profit_moq}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          {/* Row 7 */}
          <Grid item xs={12}>
            <TextField
              margin="dense"
              label="Image URL"
              name="image_url"
              value={product.image_url}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          {/* Row 8 */}
          <Grid item xs={12}>
            <TextField
              margin="dense"
              label="Title"
              name="title"
              value={product.title}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          {/* Row 9 */}
          <Grid item xs={12} sm={6}>
            <TextField
              margin="dense"
              label="Category"
              name="category"
              value={product.category}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <FormControlLabel
              control={
                <Checkbox
                  checked={product.out_of_stock}
                  onChange={handleCheckboxChange}
                  name="out_of_stock"
                  color="primary"
                />
              }
              label="Out of Stock"
            />
          </Grid>
          {/* Row 10 */}
          <Grid item xs={12} sm={6}>
            <TextField
              margin="dense"
              label="Walmart URL"
              name="walmart_url"
              value={product.walmart_url}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              margin="dense"
              label="eBay URL"
              name="ebay_url"
              value={product.ebay_url}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
        </Grid>
      </DialogContent>
      <DialogActions>
        <Button onClick={onClose} color="secondary">Cancel</Button>
        <Button onClick={handleSubmit} color="primary">
          {mode === 'edit' ? 'Update' : 'Add'}
        </Button>
      </DialogActions>
    </Dialog>
  );
};

export default ProductFormDialog;
